Never seen water on this rod & reel that will be sold as a package.

REEL;
QUANTUM PERFORMANCE SHOP ~ CABO PTS - #CLW20PTS
It has a Magnum Ceramic Drag stack in it, {labeled as such on reel side}.
Spooled with Maxima 35#; accessories and neoprene cover included.
{these reels were sent to the QuantumProShop for performance tuning}

ROD;
Berkley AIR IM7 #A92-10-6XH ~ 10'6" length ~ Lure 2-8 ~ Line 20-80
Hand selected from a carton of 48 rods, for blank straightness; reel seat placement; guide wrap & placement; cork quality; fit and finish.

This is a completely re-done Springfield Armory M1 Garand (3.6 million serial, April 1945) in 30.06. All parts are SA except the barrel, which has been replaced with an absolutely mint Danish VAR 1966 barrel. The VAR barrel is proofed and marked properly. These barrels are renown in the M1 world as phenomenal shooters and this one gauges with a TE of 0.9 and an ME of 0.9 on Fulton gauges, which is new. Try finding a Danish VAR barrel that gauges under 1 on both ends; it's not easy. The bore is mirror-like and crisp, with a perfect crown. 

The M1 has brand new gorgeous natural walnut stock and handguards. The finish matches on all the wood, and it's not shiny. Just natural USGI look. All small pins and springs have been replaced, op-rod spring replaced, and the entire M1 was re-parked in manganese phosphate, down to the handguard metal. Headspaced and timing block checked, then test fired with Greek HXP.   recently installed Fulton Armory NM sights front and rear.  Original SA front and rear sights included.

The package:  1945 SA M1 Garand; Turner Saddlery All-Weather Black 1903 style sling (J.C. Garand Match legal); CMP hard case, repro WWII soft case; At The Front repro cartridge belt w/suspenders and first aid pouch (VERY high quality); huge quantity of spare parts to keep this rifle running a long time; various M1 Garand books; approx. 3600 rds of HXP ammo that has been loaded into clips, cardboards and bandoleers and stored in .30cal USGI ammo cans; Garand specific tools and cleaning gear;
